import React from "react";

const AdminNavbar = () => {
  return (
    <div className="container-fluid" style={{ backgroundColor: "#b5cdd9" }}>
      <div className="container">
        <div className="row">
          <div className="col-12 mt-4 mb-4">
            <a href="/">

            <img
              src="/images/others/StSt_logo.png"
              alt="logo"
              style={{ width: "100px" }}
            />
            </a>
          </div>
        </div>
      </div>
    </div>
  );
};

export default AdminNavbar;
